import React, { Component } from 'react';
import './Table.css';

class Table extends Component {
    render() {
        return (
            <div className="Table-wraper">
                <table>
                    <tr>
                        <th>
                            header1
                        </th>
                        <th>
                            header2
                        </th>
                    </tr>
                    <tr>
                        <td>
            data1
                        </td>
                        <td>
            data2
                        </td>
                    </tr>
                </table>
            </div>
        );

    }
}

export default Table;
